/* UTILITY FUNCTIONS */
function convertHex(hex, opacity) {
  var hex = hex.replace('#','');
  var r = parseInt(hex.substring(0,2), 16);
  var g = parseInt(hex.substring(2,4), 16);
  var b = parseInt(hex.substring(4,6), 16);
  var result = [r, g, b, opacity/100];
  return result;
};

/**
 * OPENLAYERS MAP SETTINGS. Generate map tiles in RASTER,
 * place bus routes (in MultiLineString) and stops (in Point)
 * on the map based on their bus route (and coinciding color).
 */

/**
* Prevent users from exploring outside the EXTENT, and
* generate a view based on that extent and coordinates.
*/
function transform(extent) {
  return ol_proj.transformExtent(extent, 'EPSG:4326', 'EPSG:3857');
}

var raster = new ol_layer_Tile({
  source: new ol_source_OSM({
    "url": "http://{a-c}.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png"
  }),
});

var bubbleLayers = [];
// var bubbleStyles = {
//   'Circle': new ol_style_Style({
//     stroke: new ol_style_Stroke({
//       color: 'red',
//       width: 1
//     }),
//     fill: new ol_style_Fill({
//       color: 'rgba(255,0,0,0.2)'
//     })
//   })
// };
function bubbleStyle(feature, arg) {
  var rpo = feature.get('rpo');
  var rgb = '#ff0000';
  if (rpo < 400) {
    rgb = 'rgb(124,252,0)';
  } else if (rpo < 800) {
    rgb = 'rgb(157,189,0)';
  } else if (rpo < 1200) {
    rgb = 'rgb(190,126,0)';
  } else if (rpo < 2000) {
    rgb = 'rgb(211,84,0)';
  }
  return [new ol_style_Style({
    stroke: new ol_style_Stroke({
      color: 'black',
      width: 0
    }),
    fill: new ol_style_Fill({
      color: rgb
    })
  })]
}

// Assumes that the APARTMENTS are ordered by greatest RPO (RENT/OCCUPANT)
for (var i = 0; i < apartments.length; i++) {
  if (apartments[i].rpo < 2500) {
    var apt = apartments[i];
    var xy = ol_proj.transform([Number(apt.lon), Number(apt.lat)],'EPSG:4326','EPSG:3857');
    // console.log([apt.lon, apt.lat], xy)
    var bubbleFeature = new ol_Feature(new ol_geom_Circle(xy, 20));
    bubbleFeature.set('rpo', apt.rpo)
    var bubbleSource = new ol_source_Vector({
      features: [bubbleFeature]
    });

    var bubbleLayer = new ol_layer_Vector({
      source: bubbleSource,
      style: bubbleStyle
    });
    bubbleLayers.push(bubbleLayer);
  }
}

var view = new ol_View({
  center: ol_proj.fromLonLat([-122.2582, 37.8688]),
  // maxZoom: 18,
  // minZoom: 13,
  zoom: 15,
  // extent: ol_proj.transformExtent([-122.312443, 37.884692, -122.240036, 37.853399], 'EPSG:4326', 'EPSG:3857')
});

var map = new ol_Map({
  target: 'map',
  // interactions: ol_interaction.defaults({mouseWheelZoom:false}),
  layers: Array(raster).concat(bubbleLayers),
  view: view
});

function slugify(text)
{
  return text.toString().toLowerCase()
    .replace(/\s+/g, '-')           // Replace spaces with -
    .replace(/[^\w\-]+/g, '')       // Remove all non-word chars
    .replace(/\-\-+/g, '-')         // Replace multiple - with single -
    .replace(/^-+/, '')             // Trim - from start of text
    .replace(/-+$/, '');            // Trim - from end of text
}
